import React from 'react';
import './Skills.css';
import DatabaseStack from './DatabaseStack'; // 确保路径正确

const Skills = () => {
  // 假设这里有一个skills数组，您可以根据实际情况进行调整
  const skills = [
    { id: 1, title: 'JavaScript', img: 'path/to/image', content: 'Some description' },
    // 更多技能...
  ];

  if (!skills.length) return null;

  return (
    <section className='skills' id='skills'>
      <div className="container">
        <div className="row justify-content-center">
          <div className="col-lg-8 text-center">
            <div className="main_title">
              <h2>Skills</h2>
              <p>Below are some of my skills that I am efficient in.</p>
            </div>
          </div>
        </div>
        <div className="row feature_inner justify-content-center">
          {skills.map((skill) => (
            <div key={skill.id} className="col-lg-3 col-md-6">
              <div className="feature_item">
                <img src={skill.img} alt={skill.title} />
                <h4>{skill.title}</h4>
                <p>{skill.content}</p>
              </div>
            </div>
          ))}
        </div>
        <DatabaseStack />
      </div>
    </section>
  );
};

export default Skills;
